    "synopsis": "Discover fresh insights into several Greek myths that teach us about the relationship between gods and humans. Is Prometheus a troublemaker (according to Hesiod) or a liberator (according to Aeschylus)? What happened after Pandora's box of evil spirits was opened? How did Persephone's kidnapping inspire the Eleusinian Mysteries? Begin your journey into the mythology of Asia and the Pacific with the story of Fu Xi, which illustrates a profound truth about both Chinese society and the mythology of the Pacific Rim: culture and human relations come first. See how the importance of social networks, the omnipresence of water, and the value of sacrifice comprise the three key motifs of the myths of this region. Journey through the Great Plains to look at new myths involving creatures and environments that can't be duplicated in other regions. Hear the fascinating story of the Buffalo Woman, and learn the way myths not only connect different groups of people, but also serve as a beacon of individuality. Jump into the distinctive elements of African mythology with the story of Shango--a fearsome king of the city-kingdom of Oyo who later became a god. Explore how the cyclical structure of the story is another distinctive feature of African myths. Rather than moving in a straight line, African myths may start in the middle, seem to end, circle back to the beginning, and then reach a conclusion. Investigate the mythological roots and legacies of the powerful--but flawed--Greek hero, Herakles. Explore common threads that run through some of his twelve labors, including the slaying of the Hydra and the cleaning of the Augean stables. Also, ponder Herakles's role in ancient Greek society as both mortal and god. Hear a riveting Inuit story of Sedna, the Old Woman (or Earth Mother) who lives under the sea. You'll also encounter the Nanabushu stories and the archetype of the Trickster, who is often a cultural hero, responsible for aiding in the creation of what we know today. Welcome to the ancient Greek myths: some of the most popular, well-known stories in Western civilization. When did these tales emerge, and what are our earliest sources for them? Find out in this lecture on father-son conflicts between Uranus, Kronos, Zeus, and the other first-generation gods known as the Titans.",
