    "synopsis": "New York is one of the most dynamic and fastest paced cities in the world, with a complex structure representing all layers of society. At the summit are the \"Kings and Queens\" - The Vanderbilts, Rockefellers and Kennedys; the paragons of Western Civilization. But at the lowest level of this urban landscape lies a dark and frightening place, pulled from the pages of a macabre science fiction novel. A place which is inhabited by the \"Mole People\". Voices in the Tunnels takes you on an investigative search of this urban myth - The existence of a fragmented outcast people living on the fringes of society in New York' underbelly. People who live in dark morbid dwellings where most of us would dread visiting, let alone living. Without a map or blueprint, the film crew investigates this story, following leads based on fact and fiction, myth and reality. In our search, we traverse vast, dark, windless tunnels - Sometimes finding nothing but a pale reflection of our souls in a place without solace. Only when they were ready, did those living below the busy streets of New York reveal themselves to us. Some of these inhabitants found the pressures of daily life too demanding and hard to bear to the point that skulking with rats below seemed easier than the \"rat race\" above. Others simply found peace and comfort in their solitude and engulfing darkness. As with any other society, this one too has a code of conduct and dictates of ethics that places theft from other underground dwellers as a more serious crime than murder - After all, when you have so little, what you do have is priceless. Six years after the first real evidence of these underground dwellers was revealed in Jennifer Toths' book \"The Mole People\", our film continues where she left off ...",
