    "synopsis": "Jeff Wall is one of the most important and influential photographers working today. His work played a key role in establishing photography as a contemporary art form. Jeff Wall describes his recent work as \"near documentary,\" a plausible account or a report on real or imagined encounters. Wall usually spends weeks painstakingly recreating these encounters and taking many pictures, from which he selects his final image in a critical process. His photographs are mainly displayed as backlit Cibachrome transparencies. In an interview with Sheena Wagstaff, Chief Curator at the Tate Modern, he said: Evaluation of quality is the core of the pleasure of the experience of art; the simultaneous pleasure of enjoying something intensely and of recognizing that it is a good work. I always judge my picture - daily, hourly, all the time. Even though it's disappointing to have to say \"that one is not good\", or \"not as good as that one\", it is still a pleasure to go through that process and experience a work afresh. Nothing has been as destructive to the condition of art as the idea that qualitative judgment is unimportant, and that art is important for cultural reasons. Art can only be important if it is good, because if it is good, it pleases us in ways we don't anticipate and don't understand, and that pleasure means something to us even if we can't specify what, exactly.",
