    "synopsis": "Counting Headz is a platform for stories that are often drowned out among the male voices in hip hop. This ground-breaking documentary reveals the position of South Africa's women today; their stories are mediated through the experiences of three major artists in South Africa's hip hop scene. MC Chi introduces the alleged contradiction of values between African and hip hop cultures. Is it possible to reconcile the two? Is it worth it to reconcile the two? Her questions thread together the obstacles encountered by fellow sistaz. DJ Sistamatic challenges a distorted portrayal of her image in the media. Candidly, she recounts her resistance to conform to female stereotypes as she continues to make a name for herself. Family relationships are tested when daughters step outside traditional roles; Graffiti artist Smirk works beyond her family's initial misgivings about her art and prepares to merge living hip hop and being a mother. Alternately, they are supported and contradicted by an all-female community of hip hop artists and activists from the locally respected MC, Cuba, to the internationally acclaimed crew, Godessa. Counting Headz is a collaboration, a labour of love, a celebration. But most importantly, it is a voice for these women's stories that are often left unheard.",
